export const TableChild = ({titre,headers,rows,buttons}) => {
    return (
        <>
            <h5>{titre}</h5>
            <br/>
            <table id="myDataTable" className="table" style={{width: '100%'}}>
                <thead>
                <tr>
                    {headers.map((header,index) => (
                        <th key={index}>{header}</th>
                    ))}
                </tr>
                </thead>
                <tbody>
                {rows.map((row,index) => (
                    <tr key={index}>
                        {row.map((cell,index) => (
                            <td key={index}>{cell}</td>
                        ))}
                        {
                            buttons.map((button,index) => (
                                <td key={index}>
                                    <button className={button.className}>
                                        <i className={button.icon}></i> {button.value}
                                    </button>
                                </td>
                            ))
                        }
                    </tr>
                ))}
                </tbody>
            </table>
        </>
    )
}
